    def majorityElement(self, nums):
        """
         :type nums: List[int]
         :rtype: List[int]
         """
        if not nums:
            return []
        if len(nums) == 1:
            return nums
        if len(nums) == 2:
            if nums[0] == nums[1]:
                return nums
            else:
                return nums[:1]
        count1 = 0
        count2 = 0
        candidate1 = None
        candidate2 = None
        for num in nums:
            if candidate1 == num:
                count1 += 1
            elif candidate2 == num:
                count2 += 1
            elif count1 == 0:
                candidate1 = num
                count1 = 1
            elif count2 == 0:
                candidate2 = num
                count2 = 1
            else:
                count1 -= 1
                count2 -= 1
        return [num for num in (candidate1, candidate2) if nums.count(num) >
            len(nums) // 3]

