def get_grip(image):
    touch_points = defaultdict(list)
    for y, line in enumerate(image):
        for x, c in enumerate(line):
            if c == 'X':
                touch_points[(x, y)].append((x, y))
    touch_points = list(touch_points.values())
    n = len(touch_points)
    grip_points = [(0, 0) for _ in range(n)]
    for i, touch in enumerate(touch_points):
        for x, y in touch:
            grip_points[i] = (grip_points[i][0] + x, grip_points[i][1] + y)
    for i, grip in enumerate(grip_points):
        grip_points[i] = (grip[0] / n, grip[1] / n)
    grip = (0, 0)
    for x, y in grip_points:
        grip = (grip[0] + x, grip[1] + y)
    grip = (grip[0] / n, grip[1] / n)
    return grip_points, grip


def get_grip_spread(grip_points):
    n = len(grip_points)
    spread = 0
    for x, y in grip_points:
        spread = spread + ((x - grip[0]) ** 2 + (y - grip[1]) ** 2) ** 0.5
    return spread / n


def get_grip_rotation(grip_points, grip):
    n = len(grip_points)
    rotation = 0
    for i, (x, y) in enumerate(grip_points):
        dx = x - grip[0]
        dy = y - grip[1]
        dx2 = dx * dx
        dy2 = dy * dy
        if dx2 > dy2:
            rotation = rotation + atan2(dy, dx)
        else:
            rotation = rotation + atan2(dy, -dx)
    return rotation / n


def get_distance(grip_points1, grip_points2):
    n = len(grip_points1)
    distance = 0
    for i in range(n):
        distance = distance + ((grip_points1[i][0] - grip_points2[i][0]) ** 2
            + (grip_points1[i][1] - grip_points2[i][1]) ** 2) ** 0.5
    return distance / n


def get_angle(angle):
    if angle > pi:
        return angle - 2 * pi
    if angle < -pi:
        return angle + 2 * pi
    return angle


def get_direction(grip_rotation):
    grip_rotation = get_angle(grip_rotation)
    if grip_rotation > 0:
        return 'clockwise'
    if grip_rotation < 0:
        return 'counter-clockwise'
    return 'none'


def get_gesture(image1, image2):
    grip_points1, grip1 = get_grip(image1)
    grip_points2, grip2 = get_grip(image2)
    grip_spread1 = get_grip_spread(grip_points1)
    grip_spread2 = get_grip_spread(grip_points2)
    grip_rotation1 = get_grip_rotation(grip_points1, grip1)
    grip_rotation2 = get_grip_rotation(grip_points2, grip2)
    distance = get_distance(grip_points1, grip_points2)
    spread_distance = abs(grip_spread2 - grip_spread1)
    rotation_distance = abs(grip_rotation2 - grip_rotation1)
    if distance > spread_distance and distance > rotation_distance:
        return 'pan', distance
    if spread_distance > distance and spread_distance > rotation_distance:
        if grip_spread2 < grip_spread1:
            return 'zoom out', distance
        else:
            return 'zoom in', distance
    if rotation_distance > distance and rotation_distance > spread_distance:
        direction = get_direction(grip_rotation2)
        return 'rotate ' + direction, distance


