import math


def dist(x1, y1, x2, y2):
    return math.sqrt((x1 - x2) ** 2 + (y1 - y2) ** 2)


def solve(x1, y1, x2, y2, v_max, t, v1, v2):
    v1 = math.sqrt(v1[0] ** 2 + v1[1] ** 2)
    v2 = math.sqrt(v2[0] ** 2 + v2[1] ** 2)
    if v1 + v2 > v_max:
        return -1
    if v1 == 0:
        return dist(x1, y1, x2, y2) / v2
    if v2 == 0:
        return dist(x1, y1, x2, y2) / v1
    d = dist(x1, y1, x2, y2)
    if d <= v1 * t:
        return d / v1
    else:
        return t * v1 + (d - v1 * t) / v2


def main():
    x1, y1, x2, y2 = list(map(int, input().split()))
    v_max, t = list(map(int, input().split()))
    v1 = tuple(map(int, input().split()))
    v2 = tuple(map(int, input().split()))
    ans = solve(x1, y1, x2, y2, v_max, t, v1, v2)
    if ans == -1:
        print('Infinity')
    else:
        print(ans)


